-- VERIFICATION QUERIES:
-- Check final counts by test mode and section
SELECT test_mode, section_name, COUNT(*) as question_count
FROM questions 
WHERE test_type = 'EduTest Scholarship (Year 7 Entry)'
GROUP BY test_mode, section_name
ORDER BY test_mode, section_name;

-- Check drill questions by sub-skill and difficulty
SELECT section_name, sub_skill, difficulty, COUNT(*) as question_count
FROM questions 
WHERE test_type = 'EduTest Scholarship (Year 7 Entry)' AND test_mode = 'drill'
GROUP BY section_name, sub_skill, difficulty
ORDER BY section_name, sub_skill, difficulty;
